var autocomplete_data_static={};$(document).ready(function(){$('input[data-provide="typeahead"][data-source-array]').each(function(){obj=$(this);var e=JSON.parse(obj.attr("data-source-array").replace(/&quot;/g,'"'));obj.typeahead({source:e,items:obj.attr("data-items"),minLength:obj.attr("data-min-length")})});$('input[data-provide="typeahead"][data-source]').each(function(){obj=$(this);var e=obj.attr("id");autocomplete_data_static[e]={map:[],values:[]};$.get(obj.attr("data-source"),function(t){$.each(t,function(t,n){autocomplete_data_static[e]["values"].push(n[1]);autocomplete_data_static[e]["map"][n[1]]=n[0]});obj.typeahead({source:autocomplete_data_static[e]["values"],updater:function(t){obj_id=$("#"+obj.attr("data-field-id"));if(obj_id)obj_id.val(autocomplete_data_static[e]["map"][t]);return t},items:obj.attr("data-items"),minLength:obj.attr("data-min-length")})},"json")});$('input[data-provide="typeahead"][data-source-query]').each(function(){obj=$(this);obj.typeahead({source:function(e,t){obj=this.$element;rows=[];var n=obj.attr("name");autocomplete_data_static[n]={map:[],values:[]};$.getJSON(obj.attr("data-source-query"),{q:e},function(e){$.each(e,function(e,t){autocomplete_data_static[n]["values"].push(t[1]);autocomplete_data_static[n]["map"][t[1]]=t[0]});t(autocomplete_data_static[n]["values"])})},updater:function(e){obj=this.$element;var t=obj.attr("name");obj_id=$("#"+obj.attr("data-field-id"));if(obj_id)obj_id.val(autocomplete_data_static[t]["map"][e]);return e},items:obj.attr("data-items"),minLength:obj.attr("data-min-length")})})})